, chế tạo máy','Với đội ngũ kỹ sư nhiều kinh nghiệm làm việc trong nhiều lĩnh vực, chúng tôi đưa ra các giải pháp công nghệ kỹ thuật từ đó thiết kế chế tạo máy theo nhu cầu của khách hàng.<br />\nNhững sản phẩm tưởng như không thể, phức tạp khi đến với chúng tôi sẽ đơn giản và tối ưu nhất.',2,0),(12,'2017-09-28 13:34:48','2017-09-28 13:34:48','127.0.0.1','home_section_3','Dịch vụ của chúng tôi','Với phương châm mang lại sự hài lòng cho khách hàng.<br />\nSản phẩm của chúng tôi được kiểm tra nghiêm ngặt từ khâu đầu vào, quá trình sản xuất cho tới khâu kiểm định,  đóng gói và vận chuyển để mang lại sản phẩm đạt chất lượng và đáp ứng nhanh tiến độ.',3,0),(13,'2017-09-28 13:37:18','2017-09-28 13:37:18','127.0.0.1','home_section_4','Chúng tôi phục vụ các nhu cầu chế tạo','left',1,0),(14,'2017-09-28 13:37:32','2017-09-28 13:37:32','127.0.0.1','home_section_4','Các dịch vu gia công cơ khí chính xác,  thiết kế chế tạo của chúng tôi đáp ứng nhu cầu của nhiều ngành công nghiệp với quy mô lớn và nhỏ.','left',2,0),(15,'2017-09-28 13:37:41','2017-09-28 13:37:41','127.0.0.1','home_section_4','Ngoài ra chúng tôi còn đáp ứng nhanh tiến độ theo từng yêu cầu của khách hàng.','left',3,0),(16,'2017-09-28 13:37:54','2017-09-28 13:37:54','127.0.0.1','home_section_4','Với sự chuyên nghiệp, giàu kinh nghiệm và tận tâm sẽ mang lại sự hài lòng cho khách hàng.','right',1,0),(17,'2017-09-28 13:38:03','2017-09-28 13:38:03','127.0.0.1','home_section_4','Chúng tôi tự hào mang lại chất lượng sản phẩm và dịch vụ cao nhất cho khách hàng.','right',2,0),(18,'2017-09-28 13:38:11','2017-09-28 13:38:11','127.0.0.1','home_section_4','Hãy liên hệ với chúng tôi nếu như bạn có nhu cầu cũng như bất kỳ câu hỏi nào.','right',3,0),(19,'2017-09-28 13:58:00','2017-09-28 13:58:00','127.0.0.1','product_section_3','Gia công chi tiết máy.','left',1,0),(20,'2017-09-28 13:58:21','2017-09-28 13:58:21','127.0.0.1','product_section_3','Gia công khuôn mẫu.','left',2,0),(21,'2017-09-28 13:58:28','2017-09-28 13:58:28','127.0.